toi.<\\/p>\",\"align\":\"center\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"px\",\"size\":27,\"sizes\":[]},\"_margin\":{\"unit\":\"px\",\"top\":\"80\",\"right\":\"80\",\"bottom\":\"80\",\"left\":\"80\",\"isLinked\":true},\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":20,\"sizes\":[]},\"_margin_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":true}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"e7f0d3e\",\"elType\":\"section\",\"settings\":{\"structure\":\"22\",\"margin\":{\"unit\":\"px\",\"top\":\"100\",\"right\":0,\"bottom\":\"100\",\"left\":0,\"isLinked\":true}},\"elements\":[{\"id\":\"f9d9aa5\",\"elType\":\"column\",\"settings\":{\"_column_size\":66,\"_inline_size\":null},\"elements\":[{\"id\":\"69eb1c6\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Si jamais tu as des questions ou besoin de support,<br \\/>contacte-nous via\\u00a0<a href=\\\"aide.html\\\">Aide\\u00a0<\\/a>!<br \\/>On se tient \\u00e0 ta disposition d\\u00e8s que tu en as besoin !<\\/p>\",\"align\":\"center\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"px\",\"size\":25,\"sizes\":[]},\"_margin\":{\"unit\":\"px\",\"top\":\"40\",\"right\":\"40\",\"bottom\":\"40\",\"left\":\"40\",\"isLinked\":true},\"_animation\":\"none\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"a549537\",\"elType\":\"column\",\"settings\":{\"_column_size\":33,\"_inline_size\":null},\"elements\":[{\"id\":\"2c4d31c\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/wordpress\\/wp-content\\/uploads\\/2020\\/04\\/unnamed.jpg\",\"id\":61}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"959f358\",\"elType\":\"section\",\"settings\":{\"structure\":\"30\",\"background_background\":\"classic\",\"border_width\":{\"unit\":\"px\",\"top\":\"02\",\"right