(125, 1, '2020-05-01 19:26:31', '2020-05-01 17:26:31', '<h2>Bienvenue et Félicitations pour ce premier pas !</h2>\nSur GreenDistrict, on te conseille sur les différents gestes que tu peux changer ou améliorer au quotidien. Ne change pas tes habitudes trop radicalement, on y va progressivement pour pas que tu ne sombres du côté obscur.\n\n<img width=\"522\" height=\"297\" src=\"http://localhost/wordpress/wp-content/uploads/2020/04/handshake-1.jpeg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/04/handshake-1.jpeg 522w, http://localhost/wordpress/wp-content/uploads/2020/04/handshake-1-300x171.jpeg 300w\" sizes=\"(max-width: 522px) 100vw, 522px\">\n<h3>A ta disposition, trois secteurs qui demandent un léger effort :</h3>\n- Comment recycler ses&nbsp;<a href=\"dechets.html\">Déchets</a>\n\n- Réduire sa consommation d\'<a href=\"energie.html\">energie</a>&nbsp;chez soi\n\n- Adapter son&nbsp;<a href=\"alimentation.html\">alimentation</a>&nbsp;vis-à-vis de la situation actuelle\n\n<img width=\"1024\" height=\"783\" src=\"http://localhost/wordpress/wp-content/uploads/2020/04/77653139-le-recyclage-des-éléments-poubelles-sacs-poubelle-industrie-de-la-gestion-des-pneus-utilisent-les-déchet-1-1300x994-1-1024x783.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/04/77653139-le-recyclage-des-éléments-poubelles-sacs-poubelle-industrie-de-la-gestion-des-pneus-utilisent-les-déchet-1-1300x994-1-1024x783.jpg 1024w, http://localhost/wordpress/wp-content/uploads/2020/04/77653139-le-recyclage-des-éléments-poubelles-sacs-poubelle-industrie-de-la-gestion-des-pneus-utilisent-les-déchet-1-1300x994-1-300x229.jpg 300w, http://localhost/wordpress/wp-content/uploads/2020/04/77653139-le-recyclage-des-éléments-poubelles-sacs-poubelle-industrie-de-la-gestion-des-pneus-utilisent-les-déchet-1-1300x994-1-768x587.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/04/77653139-le-recyclage-des-éléments-poubelles-sacs-poubelle-industrie-de-la-gestion-des-pneus-utilisent-les-déchet-1-1300x994-1.jpg 1300w\" sizes=\"(max-width: 1024px) 100vw, 1024px\">\n<img width=\"765\" height=\"543\" src=\"http://localhost/wordpress/wp-content/uploads/2020/04/obama-clean-energy-standard-dependence-oil_303.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/04/obama-clean-energy-standard-dependence-oil_303.jpg 765w, http://localhost/wordpress/wp-content/uploads/2020/04/obama-clean-energy-standard-dependence-oil_303-300x213.jpg 300w\" sizes=\"(max-width: 765px) 100vw, 765px\">\n<img width=\"717\" height=\"536\" src=\"http://localhost/wordpress/wp-content/uploads/2020/04/food.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/04/food.jpg 717w, http://localhost/wordpress/wp-content/uploads/2020/04/food-300x224.jpg 300w\" sizes=\"(max-width: 717px) 100vw, 717px\">\n<img width=\"468\" height=\"390\" src=\"http://localhost/wordpress/wp-content/uploads/2020/04/fier.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/04/fier.jpg 468w, http://localhost/wordpress/wp-content/uploads/2020/04/fier-300x250.jpg 300w\" sizes=\"(max-width: 468px) 100vw, 468px\">\n\nTu es déjà très prometteur si tu lis toujours!\nTa planète croit en toi.\n\nSi jamais tu as des questions ou besoin de support,\ncontacte-nous via&nbsp;<a href=\"aide.html\">Aide&nbsp;</a>!\nOn se tient à ta disposition dès que tu en as besoin !\n\n<img width=\"394\" height=\"338\" src=\"http://localhost/wordpress/wp-content/uploads/2020/04/unnamed.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/04/unnamed.jpg 394w, http://localhost/wordpress/wp-content/uploads/2020/04/unnamed-300x257.jpg 300w\" sizes=\"(max-width: 394px) 100vw, 394px\">', 'Accueil', '', 'inherit', 'closed', 'closed', '', '24-revision-v1', '', '', '2020-05-01 19:26:31', '2020-05-01 17:26:31', '', 24, 'http://localhost/wordpress/2020/05/01/24-revision-v1/', 0, 'revision', '', 0),
