(109, 1, '2020-05-01 08:46:58', '2020-05-01 06:46:58', '<h2>Les déchets\n</h2>		\n		<p>Le code couleur des poubelles peut être différentes entre chaque commune, renseigne toi auprès de ta mairie pour être fixé</p>		\n			<a href=\"#\" role=\"button\">\n						En savoir plus \n					</a>\n			<h2>Les bacs vert ou gris:</h2>		\n										<img width=\"727\" height=\"1024\" src=\"http://localhost/wordpress/wp-content/uploads/2020/05/trash-can-23640_1280-727x1024.png\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/05/trash-can-23640_1280-727x1024.png 727w, http://localhost/wordpress/wp-content/uploads/2020/05/trash-can-23640_1280-213x300.png 213w, http://localhost/wordpress/wp-content/uploads/2020/05/trash-can-23640_1280-768x1081.png 768w, http://localhost/wordpress/wp-content/uploads/2020/05/trash-can-23640_1280.png 909w\" sizes=\"(max-width: 727px) 100vw, 727px\" />											\n		<p>-Les cartons et papiers</p><p>-Les bouteilles, flacons et bidons en plastique avec leur bouchon</p><p>-Les emballages en métal</p><p> </p>		\n			<h2>Les bacs bleus/jaunes:\n</h2>		\n		<p>Les sacs poubelles bien fermés, qui contiennent tes déchêts alimentaire et résiduels: du genre mouchoirs, lingettes, les emballages en plastique très légers</p> 		\n										<img width=\"962\" height=\"1024\" src=\"http://localhost/wordpress/wp-content/uploads/2020/05/trash-313711_1280-962x1024.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/05/trash-313711_1280-962x1024.jpg 962w, http://localhost/wordpress/wp-content/uploads/2020/05/trash-313711_1280-282x300.jpg 282w, http://localhost/wordpress/wp-content/uploads/2020/05/trash-313711_1280-768x817.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/05/trash-313711_1280.jpg 1203w\" sizes=\"(max-width: 962px) 100vw, 962px\" />', 'Déchêts', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2020-05-01 08:46:58', '2020-05-01 06:46:58', '', 11, 'http://localhost/wordpress/2020/05/01/11-revisi